  \"Improving Multiple Fault Diagnosability using Possible Conflicts\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 6,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:04:13.931862\",\n\t\"name\": \"improving-multiple-fault-diagnosability-using-possible-conflicts-13ffc\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Multiple fault diagnosis is a difficult
  problem for dynamic systems. Due to fault masking, compensation, and relative time
  of fault occurrence, multiple faults can manifest in many different ways as observable
  fault signature sequences. This decreases diagnosability of multiple faults, and
  therefore leads to a loss in effectiveness of the fault isolation step. We develop
  a qualitative, event-based, multiple fault isolation framework, and derive several
  notions of multiple fault diagnosability. We show that using Possible Conflicts,
  a model decomposition technique that decouples faults from residuals, we can significantly
  improve the diagnosability of multiple faults compared to an approach using a single
  global model. We demonstrate these concepts and provide results using a multi-tank
  system as a case study. \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
